      // This script checks to see if a redirect is present in the query string
      // and converts it back into the correct url and adds it to the
      // browser's history using window.history.replaceState(...),
      // which won't cause the browser to attempt to load the new url.
      // When the single page app is loaded further down in this file,
      // the correct url will be waiting in the browser's history for
      // the single page app to route accordingly.
      (function (l) {
        if (l.search) {
          var q = {};
          l.search
            .slice(1)
            .split('&')
            .forEach(function (v) {
              var a = v.split('=');
              q[a[0]] = a.slice(1).join('=').replace(/~and~/g, '&');
            });
          if (q.p !== undefined) {
            window.history.replaceState(
              null,
              null,
              l.pathname.slice(0, -1) +
                (q.p || '') +
                (q.q ? '?' + q.q : '') +
                l.hash
            );
          }
        }
      })(window.location);</script><link rel="icon" href="favicon.ico?c8279c296c354c4d88c8"><link href="css/styles.7fb5d9.css?c8279c296c354c4d88c8" rel="stylesheet"></head><body><div id="root"></div><script src="./js/runtime.d3fe2c.js?c8279c296c354c4d88c8"></script><script src="./js/styles.165cfc.js?c8279c296c354c4d88c8"></script><script src="./js/reactVendor.77f63d.js?c8279c296c354c4d88c8"></script><script src="./js/vendors.efd259.js?c8279c296c354c4d88c8"></script><script src="./js/app.c83ea2.js?c8279c296c354c4d88c8"></script></body></html>
